INSERT INTO `goldbook` VALUES (1,'2014-12-10 00:00:00','Xavier (Eysines)','xavier@gonzalez.pm','Un accueil génial, des cours au top, très belle salle et prof très pro.',1),(2,'2014-12-10 00:00:00','Frederic (Mérignac)','fredericlesca@iconeo.fr','Un accueil et un suivi hors paire, très beau lieu, très convivial',1),(8,'2015-01-08 00:00:00','Pierre','pedro@free.fr','Les cours d\'aquabike dans cette super piscine sont vraiment super.\r\nLes profs sont très sympa et très compétents.\r\nJe recommande chaudement !',1),(10,'2015-03-05 00:00:00','Lionel','lbarrere@live.fr','La salle de musculation est très complète, les équipements sont variés et permettent un travail complet. L\'équipe dirigeante est particulièrement super !!!!',1),(11,'2015-08-31 00:00:00','hugo','mathieu.hugoma@orange.fr','Super club de sport que je recommande a tout le monde.',1),(12,'2016-04-29 00:00:00','Smithf544','smithf346@gmail.com','I really enjoy the place. Great.',1),(13,'2017-02-21 00:00:00','LILOU','soleil_@hotmail.com','belle salle mais dommage que nous n avons pas accès a la piscine libre afin de nous déstressé!!!! et pouvoir etre autonme et libre ce qui nous ferait un bien fou!!!!!!!!!!!!\r\n\r\nsinon équipe sympa ',0),(14,'2017-07-05 00:00:00','Daouda','daoudafall85@yahoo.fr','Une équipe chaleureuse et très pro, un cadre moderne et propre. Mention spéciale à MATTHIEU de l\'aquagym et des cours de natation, pour sa méthode exemplaire ...',1),(15,'2017-09-03 00:00:00','Hélène','helene.blut@yahoo.fr','Une rénovation très réussie: superbe piscine et espaces revalorisés + une nouvelle équipe hyper dynamique (merci au trio de filles et bien sur au chef Audric). C\'est un grand plaisir de faire partie du SPORT ONE.',1),(16,'2017-09-10 00:00:00','f','ioue@bz.fr','nice',1),(17,'2017-09-19 00:00:00','Niwinski jean-marc','jmn2sxb@orange.fr','La plus belle salle de Bordeaux, une excellente ambiance et des tarifs compétitifs. Tout pour plaire!',1),(18,'2017-10-06 00:00:00','Mathilde','mathilde.cot6@gmail.com','Super salle de sport avec un très grand nombre de cours collectifs mais surtout une équipe de tonnerre ! Hyper motivante et dynamique qui donne envie d\'y aller tous les jours :-)',1),(19,'2017-12-02 00:00:00','Julie','pecopec33@hotmail.com','La salle est spacieuse , belle piscine , super cours d\'aquabike ! \r\nje recommande',1),(20,'2018-01-12 00:00:00','Sylvie','sylvie.ratineau-levraud@orange.fr','Je suis adepte depuis au moins 5 ans ......a vous de juger !',1),(21,'2018-01-24 00:00:00','FLORENT DRUCBER','miaouaf@gmail.com','Une super salle avec du très bon matos!!',1),(22,'2018-02-28 00:00:00','Dada','dalila.khaldi@yahoo.com','Bon...vu que sur ma page,..le dernier message daté de 02/12/2017, j\'entame 2018 Àvec un ++++au dernier cours de Lola en aquabike ! Nickel ! Dommage d\'avoir une angine cette semaine pour ne pas pouvoir venir ! A la semaine prochaine sans microbes pour tout le monde ! ',1),(23,'2018-04-02 00:00:00','Isabelle ','boulayisa@gmail.com','Salle au top, supers cours collectifs, toute l\'équipe de coachs est au top !! Toujours le sourire, l\'envie de te pousser à max dans tes  limites, pep\'s de fou et toutes et tous passionnés. \r\nLa meilleure salle !!!! ',1),(24,'2018-06-29 00:00:00','Dechelle','mari-yo@live.fr','Salle époustouflante et coachs hyper motivants sympathiques compétents et d\'une professionnalité exemplaire.\r\nJe regrette cependant, encore et toujours, le départ de Matthieu qui en plus de tout cela me donnait la joie de vivre , dans une atmosphère de travail et de plaisir.',0),(25,'2018-07-20 00:00:00','Isabelle Longpre','islo07_@hotmail.com','Je souhaite de belles vacances à toute la super équipe de pros! Le bikini me va à la merveille...lol... merci Laurie, Roxanne, Ludivine et Bruno! On se revoit fin août!',1),(26,'2018-09-03 00:00:00','Isabelle ','boulayisa@gmail.com','Un an que je suis inscrite dans cette superbe salle au top. Super coachs, super cours, un choix important de cours en salle ou en piscine, super accueil et conseils au top, professionnalisme et sourire au rendez-vous. Pour tous niveaux. ',1),(27,'2019-02-01 00:00:00','Jerome B','jeromebolla@me.com','Les cours ont vraiment du punch, les coach poussent bien avec beaucoup de convivialité de patience et de bienveillance ce qui donne encore plus envie de faire des efforts. Découvrir la Boxe avec un pro c\'est top il donne envie de se passionner pour ce sport pourtant extrêmement technique, grâce à une approche très ludique. L\'ambiance plutôt cool même aux heures d\'affluence.',1),(28,'2019-03-20 00:00:00','Emma ','beauteongle@orange.fr','Super cours , coachs géniaux , superbe salle je la recommande !!! Merci sport One ',1),(29,'2019-10-28 00:00:00','lubin gregorio','lubingregorio@gmail.com','La boxe ma vraiment aidé, je recommande ',1),(30,'2019-11-05 00:00:00','MONIQUE KARLSSON','mokarlsson@orange.fr','AVIS',0),(31,'2019-11-05 00:00:00','MONIQUE KARLSSON','mokarlsson@orange.fr','Malgré un problème de santé incompatible avec une activité en salle   diagnostic  médical envoyé  depuis plusieurs mois je ne fréquente plus la salle   on me demande néanmoins de payer 59 E par mois jusqu\'au mois de mars  2020     très mal reçue téléphoniquement    je n\'ai pu avoir un responsable    ',0);
