INSERT INTO `news` VALUES (19,'2019-01-01 00:00:00','planning des activités SAISON 2018/2019 en ligne','bonne rentrée à tous nos adhérents....\r\nle planning est en ligne sur le site à voir sur votre pc ou sur votre smartphone \r\n','<h2><strong><a href=\"/planning.php#contenu\">Planning</a></strong></h2>'),(20,'2019-02-02 00:00:00','RESERVATIONS AQUABIKE','A présent réservez vos séances d\'aquabike en ligne. ','<p>Pour vos reservation AQUABIKE cliquez sur le lien suivant&nbsp;<a title=\"AQUABIKE\" href=\"https://cloud.heitzsystem.com/heitzfit/1330/app\" target=\"_blank\">RESERVATION AQUABIKE</a></p>'),(21,'2019-06-16 00:00:00','Demandez un essai gratuit','Si vous hésitez à vous engager, n\'hésitez pas à faire la demande d\'un essai gratuit dans la(les) discipline(s) qui vous intéressent. ','<p>Si vous h&eacute;sitez &agrave; vous engager, n\'h&eacute;sitez pas &agrave; faire la demande d\'un essai gratuit dans la(les) discipline(s) qui vous int&eacute;ressent. g</p>'),(22,'2019-09-12 00:00:00','Nouveau cours Les Mills THE TRIP','Venez tester notre nouveau cours THE TRIP , unique à Bordeaux. \r\nTHE TRIP pousse votre motivation et votre énergie au niveau supérieur ! ','<p>Venez tester notre nouveau cours THE TRIP , unique &agrave; Bordeaux.&nbsp;<br />C\'est une exp&eacute;rience enti&egrave;rement immersive avec coach qui combine un entra&icirc;nement de v&eacute;lo &agrave; pics multiples avec un voyage &agrave; travers des mondes cr&eacute;&eacute;s num&eacute;riquement. Avec son &eacute;cran de cin&eacute;ma, THE TRIP pousse votre motivation et votre &eacute;nergie au niveau sup&eacute;rieur, br&ucirc;lant ainsi un paquet de calories</p>\r\n<div class=\"video-responsive\">\r\n<p><iframe src=\"https://www.youtube.com/embed/AywHEyk23cI?rel=0&amp;showinfo=0&amp;controls=1&amp;autoplay=1\" width=\"600\" height=\"400\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n</div>');
