INSERT INTO `newsletter_detail` VALUES (357,12,'Le poisson d\'avril fait son show du 30 mars au 3 avril','/uploads/newsletter/poissonavril.png','http://bsport.fr/','\"Les p\'tits poissons d\'avril font du sport !\r\n\r\nEt oui c\'était l\'ouverture de la pêche à la truite à la mi-mars... le poisson d\'avril fait son show !\r\nPour cette occasion, la team B\'sport vous présente les nouvelles chorégraphies LESMILLS.\r\n\r\nLes conditions sont simples :\r\n\r\nOn veut d\'la joie, du poisson, d\'la bonne humeur et d\'la couleur !!!\r\nOn veut du Pump 93 en poisson rouge parc\'qu\'il est costaud !\r\nOn veut du Rpm 66 en poisson bleu parc\'qu\'il est bon !\r\nOn veut du Balance 68 en poisson vert clair parc\'qu\'il est doux !\r\nOn veut du Sh\'bam 19 en poisson rose parc\'qu\'il est sexy !\r\nOn veut du Combat 63 en poisson vert kaki parc\'qu\'il est agile !\r\nOn veut du Cxworx 18 en poisson orange parc\'qu\'il est fonctionnel !\r\nOn veut d\'l\'Aquadynamic 46 et d\'l\'Aquawork 10 en maillot ben parc\'que ça mouille !!!\r\n\r\nRien de meilleur que d\'se sentir bien dans sa tête, ses pompes et son corps. Alors venez habillés en couleur et vous deviendrez costaud, bon, doux, sexy, agile, fonctionnel et un peu trempé !!\r\n\r\nPour cette occasion le club B\'sport Offre 1 mois ou 4 séances pour tout parrainage lors de cette semaine. Alors on espère que la pêche sera bonne pour vous !! Plus de renseignements et planning des relancements au port ... (l\'acceuil)\r\n\r\nEn avril ne vous découvrez pas d’un fil ( de pêche..), , habillez vous en couleur en fonction du cours, invitez vos proches, place à la bonne humeur. On compte sur vous\r\n\r\nUne p\'tite bavouille ! (bisous) '),(361,14,'RAGGA DANCEHALL ET HIP HOP NEW STYLE','/uploads/flyer_IMP.jpg','http://bsport.fr',''),(363,13,'La piscine est de nouveau opérationnelle','/uploads/piscine/bsport1.jpg','http://dev.bsport.fr/','Un grand ksdjfksj sj lksj skfj slkjsùq ùfjfklzjf eisjf kznep zjfj sk,fksjfz'),(364,13,'gtudguguj','/uploads/bsport5.jpg','http://www.bsport.fr/','gjjcjvg:kmhvkmmgimu'),(383,15,'zumba kids ','/uploads/zumba_enfant.jpg','',''),(389,17,'à partir du 29 juin 2015 jusqu\'au 17 juillet','/uploads/Planning_du_29_au_17_juillet.jpg','http://www.bsport.fr/','Votre club sera fermé du 3 au 14 aout \r\n'),(390,17,'à partir du 17 juillet','/uploads/planning_a_partir_du_17_juillet.jpg','http://www.bsport.fr/','Votre club sera fermé du 3 au 14 aout '),(391,18,'reprise des activités le 17 aout avec les meme horaires que fin juillet','/uploads/info_adherent.jpg','http://www.bsport.fr/',''),(397,19,'NOUVEAU PLANNING DE COURS','/uploads/planning/planningsept2015.jpg','http://www.bsport.fr/planning.php#contenu',' '),(406,20,'TOUTE L’ÉQUIPE  B\'SPORT VOUS SOUHAITE  UNE BONNE ET  HEUREUSE ANNÉE 2016','/img/ajoutImage.jpg','http://www.bsport.fr/','Christophe et Laurent s\'envolent vers de nouveaux horizons et Anthony Lorenzo se lance dans l\'aventure B\'Sport.\r\nB’Sport et Anthony ont hâte de tous vous rencontrer ! \r\n\r\n'),(410,21,'La piscine est de nouveau opérationnelle','/uploads/bsport5.jpg','http://bsport.fr/les-cours.php#contenu','hghjgg ggghjg jhg hjg jhg jhg hjg jhg hjg jg'),(411,21,'hghjghj','/uploads/piscine/bsport1.jpg','http://www.bsport.fr/','hghjghjgj');
